import React from 'react';
import HeaderItem from './HeaderItem';

const Header = () => {
    return (
        <div className="ui inverted segment">
            <div className="ui very relaxed horizontal list">
                <HeaderItem 
                    nav="/"
                    name="HOME"
                />
                <HeaderItem 
                    nav="/projects"
                    name="PROJECTS"
                />
                <HeaderItem 
                    nav="/resume"
                    name="RESUME"
                />
                <HeaderItem 
                    nav="/coursework"
                    name="UNDERGRADUATE COURSEWORK"
                />
            </div>
        </div>
    );
};

export default Header;
